INSERT INTO Breeding.dogs_breedings (female_id,male_id) VALUES ((select dogOf.id from (select dog.id, concat(dog.name,' ',kennel.name) as of from Breeding.dogs as dog join Breeding.dogs_kennels as dk on dog.id=dk.dog_id join Breeding.kennels as kennel on dk.kennel_id =kennel.id ) as dogOf where dogOf.of ='Aischa v.d. Eilenriede'),(select dogOf.id from (select dog.id, concat(dog.name,' ',kennel.name) as of from Breeding.dogs as dog join Breeding.dogs_kennels as dk on dog.id=dk.dog_id join Breeding.kennels as kennel on dk.kennel_id =kennel.id ) as dogOf where dogOf.of ='Eiko v. Argosstolz'));
